import React from 'react'
import './style.css';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
        <div className='balance'>
            <h3>Balance</h3>
            <h1>0</h1>
        </div>
        <div>
            <Link to='/withdraw' className='btn btn-outline-dark'>Withdraw</Link>
            <Link to='/deposit' className='btn btn-outline-dark'>Deposit</Link>
            <Link to='/transfer' className='btn btn-outline-dark'>Transfer</Link>
        </div>
    </div>
  )
}

export default Home
